title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o17705.m23 -> o17706.m28 -> o17705.m29 -> o17705.m23
  o17706.m11 -> o17705.m32 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17706.m5 -> o17705.m32 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17706.m0 -> o17705.m32 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17706.m17 -> o17705.m29 -> o17705.m23 -> o17706.m28 -> o17705.m29
  o17705.m31 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17706.m8 -> o17705.m32 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17705.m34 -> o17705.m32 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17705.m32 -> o17706.m28 -> o17705.m29 -> o17705.m23 -> o17706.m28
  o17705.m29 -> o17705.m23 -> o17706.m28 -> o17705.m29

features:
  - inheritance
  - overriding
  - method
  - polymorphism

